/**
 * @param {number[]} nums
 * @return {number}
 */
var maxSubArray = function(nums) {
    let max = nums[0]
    let dp = []
    dp[0] = nums[0]

    for(let i=1;i<nums.length;i++) {
        let value = nums[i]
        dp[i] = Math.max(dp[i-1] + value, value)       
        max = Math.max(dp[i], max)
    }
    return max
};
